import React from "react";
import { Outlet, Link, useNavigate } from "react-router-dom";
import "./AdminComponents/AdminComponents.css";
import { UserData } from "./UserData";

const AdminDashboard = () => {
  return (
    <div className="Admin">
      <div className="AdminNav">
        <Link to="Pending">Pending</Link>

        <Link to="InProgress">In-progress</Link>

        <Link to="Resolved">Resolved</Link>
      </div>

      <div>
        <div className="listOfProducts">
          <div className="productsList">
            {UserData.map((pro) => {
              return (
                <div
                  className="productDisplay"
                  onClick={() => {
                    navigate(`/AdminComponents/${pro.id}`);
                  }}
                >
                  <nav class="navbar navbar-expand-lg navbar-light bg-warning ">
                    {pro.complaint_id}
                    <button
                      class="btn btn-outline-secondary my-2 my-sm-0 ms-auto"
                      type="submit"
                    >
                      view
                    </button>
                  </nav>
                  <p>{pro.name}</p>
                  <p>{pro.description}</p>
                  <p>{pro.Complaint_details}</p>
                  <p>{pro.Phone_No}</p>
                  <p>{pro.image}</p>
                </div>
              );
            })}
          </div>
        </div>
      </div>

      <Outlet />
    </div>
  );
};
export default AdminDashboard;
